import React, { useState, useEffect } from "react";

const Valikot = (props) => {
  const [maakunnat, setMaakunnat] = useState([]);
  console.log("vai tullaanko tänne ensin");

  useEffect(() => {
    console.log("tullaanko tänne ensin");
    setMaakunnat([props.maakunnat]);
  }, []);

  const lisaaPaikat = () => {
    console.log("props:", props.maakunnat);
    let options = Object.values(maakunnat).map((maakunta) => {
      <option>{maakunta}</option>;
    });

    return options;
  };

  return (
    <div>
      <select className={"options"}>
        {setTimeout(() => {
          lisaaPaikat();
        }, 1000)}
      </select>
    </div>
  );
};

export default Valikot;
